import React, { useState } from 'react'

function Login() {
    return (
        <div className="login">
            <h1>Login</h1>
            <label>Username:</label>
            <input type="text"></input>
            <br></br>
            <label>Password:</label>
            <input type="password"></input>
            <br></br>

        </div>
    )
}

export default Login;
